import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)
const routes = [
    // base
    {
        path: '/login',
        component: () => import('../base/login.vue')
    },
    {
        path: '/index',
        component: () => import('../base/index.vue')
    },

    // conmponents
    {
        path: '/files',
        component: () => import('..')
    }
]

const router = new VueRouter({
    mode: 'history',
    routes
})

export default router
